DROP TABLE IF EXISTS T_CITY;
DROP TABLE IF EXISTS T_PRVC;
 
##全国省表
CREATE TABLE T_PRVC (
  PRVC_CD varchar(3) NOT NULL COMMENT '省编号',
  DISP_NM varchar(30) NOT NULL COMMENT '省名称',
  CD_DESC varchar(30) COMMENT '代号描述',
  DISP_SEQ_NBR int NOT NULL COMMENT '显示序号',
  ACTV_FLG varchar(1) NOT NULL COMMENT '是否可用',
  CR_BY varchar(10) COMMENT '创建人',
  CR_DTTM date COMMENT '创建时间',
  LST_UPD_BY varchar(10) COMMENT '最近更新人',
  LST_UPD_DTTM date COMMENT '最近更新时间',
  LST_TX_ACTN varchar(1) COMMENT '最近执行操作',
  PRIMARY KEY (PRVC_CD)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

##全国地级市表
CREATE TABLE T_CITY (
  CITY_CD varchar(3) NOT NULL COMMENT '市编号',
  PRVC_CD varchar(3) NOT NULL COMMENT '省编号',
  DISP_NM varchar(30) NOT NULL COMMENT '地级市名称',
  CD_DESC varchar(30) COMMENT '代号描述',
  DISP_SEQ_NBR int COMMENT '显示序号',
  ACTV_FLG varchar(1) NOT NULL COMMENT '是否可用',
  CR_BY varchar(10) COMMENT '创建人',
  CR_DTTM date COMMENT '创建时间',
  LST_UPD_BY varchar(10) COMMENT '最近更新人',
  LST_UPD_DTTM date COMMENT '最近更新时间',
  LST_TX_ACTN varchar(1) COMMENT '最近执行操作',
  PRIMARY KEY (CITY_CD),
  CONSTRAINT T_CITY_PRVC_FK FOREIGN KEY (PRVC_CD) REFERENCES T_PRVC(PRVC_CD)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;





































